import React from 'react';
import { Button, InputGroup, FormControl } from 'react-bootstrap';
import './SearchBar.css';

export default function SearchBar(props){

    return(
        <form className="searchbar">
            <InputGroup size="lg" className="label" value={this.props.value} city={this.props.cityChanged}>
                <InputGroup.Prepend>
                    <InputGroup.Text id="inputGroup-sizing-lg">enter city</InputGroup.Text>
                </InputGroup.Prepend>
                <FormControl aria-label="Large" aria-describedby="inputGroup-sizing-lg"/>
            </InputGroup>
            <Button variant="primary" id="searchbutton">search</Button>
        </form>
    )
}
